import{s as n,n as s}from"./scheduler.6db7f009.js";import{S as a,i as r,g as p,h as c,x as h,k as g,a as u,f as d}from"./index.73c2b774.js";function m(i){let e,l='<h5>1. Downloading the UDFs files</h5> <p>The UDFs files for General Maths, Math Methods and Specialist Maths are found in the &#39;Download&#39; section of the website.</p> <p>Click on the files you wish to download, these should then be downloaded as zip folders onto your computer.</p> <img src="/images/install-instruc-1.png" alt="install-step-1" class="step-img svelte-g9o53k"/> <br/> <h5>2. Extracting the UDF files</h5> <p>The zip-folder(s) should now be in the &#39;Downloads&#39; section of your file explorer.</p> <img src="/images/install-instruc-2.png" alt="install-step-2" class="step-img svelte-g9o53k"/> <p>Right click on the zip-file, then select the &#39;Extract All...&#39; option</p> <img src="/images/install-instruc-3.png" alt="install-step-3" class="step-img svelte-g9o53k"/> <p>A window displaying the path of where the files will be extracted to will now show up.</p> <p>Click on browse to change the path/location of where the files are extracted.</p> <img src="/images/install-instruc-4.png" alt="install-step-4" class="step-img svelte-g9o53k"/> <p>Find the TiNspire CX folder on your computer, its location will depend on where you set it up.</p> <p>Afterwards, double click onto it to get into the folder.</p> <img src="/images/install-instruc-5.png" alt="install-step-5" class="step-img svelte-g9o53k"/> <p>You should now see a folder called &#39;MyLib&#39; inside the folder.</p> <p>Click onto the &#39;MyLib&#39; folder then press &#39;select folder&#39;, then press &#39;extract&#39; to move the folder into the &#39;MyLib&#39; folder.</p> <img src="/images/install-instruc-6.png" alt="install-step-6" class="step-img svelte-g9o53k"/> <p>A folder titled &#39;MM3&amp;4_UDFs&#39; should now be in your &#39;MyLib&#39; folder.</p> <p>Now simply move the TiNspire files out of &#39;MM3&amp;4_UDFs&#39; and into &#39;MyLib&#39;. You can then delete the &#39;MM3&amp;4_UDFs&#39; folder.</p> <h5>3. Transferring UDFs to the handheld CAS</h5> <p>There are two different methods. Either using the student software or using Ti-Nspire Connect (if your student software has expired).</p> <h6>Using the Student Software</h6> <p>Connect your handheld CAS to your computer using the black connection cabel.</p> <p>Your handheld should then appear at the bottom of the folder section.</p> <img src="/images/install-instruc-8.png" alt="install-step-8" class="step-img svelte-g9o53k"/> <p>Click onto your CAS calculator to get into its files.</p> <p>Finally, drag your MyLib folder into your CAS calculator. This will transfer the UDFs files into your handheld CAS.</p> <img src="/images/install-instruc-9.png" alt="install-step-9" class="step-img svelte-g9o53k"/> <p><b>Note:</b> You may need to refresh libraries in order to see the UDFs. This is: Menu, 1, 7, 1</p> <h6>Using Ti-Nspire Connect</h6> <p>You can access Ti-Nspire Connect</p> <p>Connect your handheld CAS to your computer using the black connection cabel, then press &#39;Connect Calculator&#39;.</p> <p>You will then be taken to a window where you will be prompted to select your calculator then press connect.</p> <img src="/images/install-instruc-10.png" alt="install-step-10" class="step-img svelte-g9o53k"/> <p>You will then be taken to a window displaying multiple options, select &#39;Transfer File&#39;</p> <img src="/images/install-instruc-11.png" alt="install-step-11" class="step-img svelte-g9o53k"/> <p>Then select from computer to calculator.</p> <img src="/images/install-instruc-12.png" alt="install-step-12" class="step-img svelte-g9o53k"/> <p>Afterwards select the &#39;from computer&#39; option.</p> <img src="/images/install-instruc-13.png" alt="install-step-13" class="step-img svelte-g9o53k"/> <p>You will then be taken to your file explorer, where you can select the TiNspire files you wish to transfer.</p> <img src="/images/install-instruc-14.png" alt="install-step-14" class="step-img svelte-g9o53k"/> <p>Once you have transfered all the files, go onto your handheld then cut (Ctrl + X) and paste (Ctrl + V) the files into your MyLib folder.</p> <p><b>Note:</b> You may need to refresh libraries in order to see the UDFs. This is: Menu, 1, 7, 1</p>';return{c(){e=p("div"),e.innerHTML=l,this.h()},l(t){e=c(t,"DIV",{class:!0,"data-svelte-h":!0}),h(e)!=="svelte-16l7bcq"&&(e.innerHTML=l),this.h()},h(){g(e,"class","install-info svelte-g9o53k")},m(t,o){u(t,e,o)},p:s,i:s,o:s,d(t){t&&d(e)}}}class y extends a{constructor(e){super(),r(this,e,null,m,n,{})}}export{y as I};
